  <ion-footer class="ion-no-border">
	<div *ngIf="footerTableDetails === true" style="box-shadow: 0px -20px 50px #00000017;max-width: 600px;margin:auto;">
	  <ion-item lines="full">
		<ion-label class="ion-text-wrap">
		  <h3 style="font-size: 16pt;font-weight:800;">TABLE {{selectedTBnum}}</h3>
		  <div style="display:flex;width:100%;align-items:center;font-weight:800;color:#949494;">
			<ion-text style="width:30%;">{{selectedTBfloor}}</ion-text>
			<ion-text style="width:10%;display: inline-flex;
			vertical-align: middle;
			align-items: center;
			justify-content: center;"><span class="dot"></span></ion-text>
			
			<ion-text style="width:60%;">{{selectedTBname}}</ion-text>
		  </div>
		</ion-label>
	  </ion-item>
	  <ion-item lines="none">
		<ion-label class="ion-text-wrap">
		  <p style="font-weight:800;color:#949494;">DO YOU WANT TO BOOK THE TABLE?</p>
		  <br>
		  <div style="display:flex; justify-content:space-between ;color:#949494;">
			<div style="width:40%;">
			  <ion-button class="small-btn hex-button" (click)="confirmBooking()" color="danger"
				style="margin:auto;width:100%;">CONFIRM</ion-button>
			</div>
			<div style="width:40%;">
			  <ion-button class="small-btn hex-button" (click)="cancelBooking()"
				style="margin:auto;--background:#B9B5B5;width:100%;">CANCEL</ion-button>
			</div>
		  </div>
		</ion-label>
	  </ion-item>
	</div> <br>
  
	<app-custom-tabs></app-custom-tabs>
  </ion-footer>
